import { useParams } from "react-router-dom";
import { useEffect, useState } from "react/cjs/react.development";
import airlineService from "../services/airline.service";



function UserPage(){

    const {flightId} = useParams();
    const [flightFrom, setFlightFrom] = useState('');
    const[flightTo, setFlightTo] = useState('');
    const[flights , setFlights] = useState([])
    const[offers , setOffers] = useState([])


    useEffect(() => {
        init();
      }, []);

    const init=()=>{

        airlineService.getAllFlights()
          .then(response => {
            console.log('Printing Flights data', response.data);
            setFlights(response.data);
          })
          .catch(error => {
            console.log('Something went wrong', error);
          }) 

          airlineService.getAllOffers()
          .then(response => {
            console.log('Printing Discounts data', response.data);
            setOffers(response.data);
          })
          .catch(error => {
            console.log('Something went wrong', error);
          }) 
      }




    return(
        <div className="container">
                    <div className="container">
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="flightfrom"
                        value={flightFrom}
                        onChange={(e) => setFlightFrom(e.target.value)}
                        placeholder="FROM.."
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="flightto"
                        value={flightTo}
                        onChange={(e) => setFlightTo(e.target.value)}
                        placeholder="TO.."
                    />
                </div>
            </div>
            <div className="container">
            <table border="2px">
                <thead>
                    <tr>
                        <td>FLIGHT NAME</td>
                        <td>FROM</td>
                        <td>TO</td>
                        <td>SEATS AVAILABLE</td>
                        <td>ECONOMIC PRICE</td>
                        <td>BUSINESS PRICE</td>
                        <td>FIRST CLASS PRICE</td>
                        <td>DEPARTURE DATE</td>
                        <td>ARRIVAL DATE</td>
                        <td>DEPARTURE TIME</td>
                        <td>ARRIVAL TIME</td>
                        <td></td>
                    </tr>
                </thead>
                <tbody>

                {
            flights.map(flight => {
                if(flight.flightFrom === flightFrom && flight.flightTo === flightTo){
              return (<tr key={flight.flightId}>
                <td>{flight.flightName}</td>
                <td>{flight.flightFrom}</td>
                <td>{flight.flightTo}</td>
                <td>{flight.totalSeats}</td>
                <td>{flight.economicPrice}</td>
                <td>{flight.businessPrice}</td>
                <td>{flight.firstClassPrice}</td>
                <td>{flight.flightDepartureDate}</td>
                <td>{flight.flightArrivalDate}</td>
                <td>{flight.flightDepartureTime}</td>
                <td>{flight.flightArrivalTime}</td>
              </tr>
              )}
            })
          }
                </tbody>
            </table >
            </div>
            <div className='container'>
            <table border="2px">
                <thead>
                    <tr>
                        <td>FLIGHT FROM</td>
                        <td>FLIGHT TO</td>
                        <td>DISCOUNT</td>
                    </tr>
                </thead>
                <tbody>

                {
            offers.map(offer => {
                if(offer.offerFrom === flightFrom && offer.offerTo === flightTo){
              return (<tr key={offer.offerId}>
                <td>{offer.offerFrom}</td>
                <td>{offer.offerTo}</td>
                <td>{offer.discount}</td>

              </tr>
              )}
            })
          }

                </tbody>
            </table>
        </div>
        <div className="container">
            <h3></h3>
        <div className='form-group'>
                <input className="form-control col-4" 
                list="datalistOptions" id="exampleDataList" placeholder="PAYMENT METHOD"/>
                            <datalist id="datalistOptions">
                            <option value="UPI"/>
                            <option value="DEBIT CARD"/>
                            <option value="CREDIT CARD"/>
                            <option value="NET BANKING"/>
                        </datalist>
                </div>
            </div>
        </div>
    )
}

export default UserPage;
